import './App.css';
import Pokemons from './data.js';


console.log(Pokemons);

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {pokemons.map((item) => <p>{item}</p>)}
        {/* <img src={data[0].image}>

        </img> */}
      </header>
    </div>
  );
}

export default App;
